import React, { Component } from 'react';
import countryNames from '../static/country-names'

class CountryListView extends Component {
  renderCountries() {
    return countryNames.map(country => <Link to={'/countries' + country['alpha-3']}>{country.name},</Link>)
  }

  render() {
    <div className="allCountries">{this.renderCountries}</div>
  }
}

export default CountryListView
